import React from "react";
import { Link, BrowserRouter as Route, link } from "react-router-dom";
import {
  Navbar,
  NavbarBrand,
  Nav,
  NavItem,
  NavLink,
} from "reactstrap";



function Header() {
  return (
    <>
     <Route>
        <Link to={"/CreatePost"} />
     </Route>
      <Navbar color="dark">
        <NavbarBrand>DDU Events</NavbarBrand>
        <Nav className="me-auto" navbar>
          <NavItem>
            <NavLink href="/CreatePost">CreatePost</NavLink>
          </NavItem>
        </Nav>
      </Navbar>
    </>
  );
}

export default Header;
